#pragma mark - data source 假数据



- (NSArray *)lines {
    NSMutableArray *array = [NSMutableArray array];
    
    NSString *keys = [self keys2];
    
    NSArray *dots = [keys componentsSeparatedByString:@" "];
    __block double x = 0;
    __block double max_y = -MAXFLOAT;
    __block double min_y = MAXFLOAT;
    [dots enumerateObjectsUsingBlock:^(id  _Nonnull obj, NSUInteger idx, BOOL * _Nonnull stop) {
        switch (idx % 3) {
            case 1:
                x = [obj doubleValue];
                break;
            case 2:
            {
                CGFloat y = -[obj doubleValue];
                max_y = MAX(max_y, y);
                min_y = MIN(min_y, y);
                [array addObject:[[LYPoint alloc] initWithPoint:CGPointMake(x, y)]];
            }
                break;
            default:
                break;
        }
    }];
    
    [self.trendView autoAdjustSectionYValueWithMaxValue:(max_y - min_y) * 1.15];
    [self.trendView autoAdjustSectionXValueWithMaxValue:x];
    self.trendView.originYValueOffset = CGPointMake(0, min_y * 1.1);
    
    LYChartLine *line = [[LYChartLine alloc] init];
    line.borderColor = [UIColor blueColor];
    line.borderWidth = 1.0f;
    line.pointArray =  [NSArray arrayWithArray:array];
    
    return @[line];
}
